  <meta charset="UTF-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1" />
  <title>Convite Gabi</title>

  <style>
    html{scroll-behavior:smooth}

/* ===== Modern Enhancements ===== */
:root{
  --primary:#1f6feb; --primary2:#7aa2f7; --accent:#00e0b8; --gold:#ffcc33;
  --ink:#0e3750;
}
/* Sticky action bar: desktop top-right, mobile bottom full-width */
.action-bar{
  position:fixed; right:18px; top:18px; z-index:9999; display:flex; gap:10px; flex-wrap:wrap;
}
@media (max-width:680px){
  .action-bar{ left:12px; right:12px; top:auto; bottom:12px; justify-content:space-between; }
}
.btn{
  display:inline-flex; align-items:center; gap:8px; padding:12px 16px; border-radius:14px; font-weight:700;
  text-decoration:none; border:1px solid rgba(0,0,0,.06); color:#fff; background: linear-gradient(180deg,#1b2a65,#0f1b52);
  box-shadow: 0 10px 24px rgba(0,0,0,.25);
}
.btn:hover{ transform: translateY(-1px); }
.btn-accent{ background: linear-gradient(180deg,#ffd84d,#ffb700); color:#0b1024; border:none; }
.btn-green{ background: linear-gradient(180deg,#00f0c7,#00bfa6); color:#021420; border:none; }
.btn-outline{ background:#0f2143cf; border:1px solid #2b3d73; }

/* Emoji/icon wiggle */
.icon-wiggle{ display:inline-block; transform-origin: 50% 70%; }
@keyframes wiggle { 0%,100%{ transform: rotate(0deg)} 25%{ transform: rotate(10deg)} 75%{ transform: rotate(-10deg)} }
.btn:hover .icon-wiggle{ animation: wiggle .4s ease-in-out; }

/* Enhance overlay card look */
.overlay{
  background: rgba(255,255,255,0.88);
  margin:0 auto; max-width:900px;
  border-radius:18px; padding:20px;
  backdrop-filter: blur(6px);
  border: 1px solid rgba(17,58,84,.12);
  box-shadow: 0 24px 80px rgba(4,10,40,.20);
}

/* Section pulse glow already present; keep it */

/* Subtle focus glow when #rsvp reached directly via hash */
:target#rsvp{ animation: glow 1.5s ease-out; }

/* Count-up chips */
.inline-chips{ display:flex; gap:10px; justify-content:center; flex-wrap:wrap; margin-top:12px; }
.inline-chips .chip{ background:#eef4ff; color:#1b3c66; border:1px solid #cfe1ff; padding:8px 12px; border-radius:999px; font-weight:700; }


    .btn.pulse { animation: pulse 1.8s infinite; }
    @keyframes pulse {
      0% { box-shadow:0 0 0 0 rgba(31,111,235,0.6); }
      70% { box-shadow:0 0 0 12px rgba(31,111,235,0); }
      100% { box-shadow:0 0 0 0 rgba(31,111,235,0); }
    }
    #rsvp.glow { animation: glow 1.5s ease-out; }
    @keyframes glow {
      0% { box-shadow:0 0 0px 0 rgba(31,111,235,0); }
      40% { box-shadow:0 0 25px 6px rgba(31,111,235,0.6); }
      100% { box-shadow:0 0 0px 0 rgba(31,111,235,0); }
    }

  <script>
    // Countdown
    (function(){

      const y = now.getFullYear();
      let target = new Date(y + '-08-30T19:30:00-03:00');
      if(target<now) target = new Date((y+1) + '-08-30T19:30:00-03:00');
      function two(n){return n<10?'0'+n:n;}
      function tick(){
        const diff = target - new Date();
        if(diff<=0){document.getElementById('countdown').innerHTML='<div class="unit">É hoje 🎉</div>';return;}
        const s=Math.floor(diff/1000);
        const d=Math.floor(s/86400);
        const h=Math.floor((s%86400)/3600);
        const m=Math.floor((s%3600)/60);
        const r=s%60;
        document.getElementById('d').textContent=d;
        document.getElementById('h').textContent=two(h);
        document.getElementById('m').textContent=two(m);
        document.getElementById('s').textContent=two(r);
        requestAnimationFrame(tick);
      }
      tick();
    })();
  </script>

        const mi = two(dt.getMinutes());
        const se = two(dt.getSeconds());
        const tz = '-0300';
        return y+mo+da+'T'+ho+mi+se+tz;
      }
      const ics = [
        'BEGIN:VCALENDAR',
        'VERSION:2.0',
        'PRODID:-//kaualindo//convite//PT-BR',
        'BEGIN:VEVENT',
        'DTSTART:' + toICSDate(start),
        'DTEND:' + toICSDate(end),
        'SUMMARY:' + title,
        'DESCRIPTION:' + details,
        'LOCATION:' + location,
        'END:VEVENT',
        'END:VCALENDAR'
      ].join('\r\n');
      const blob = new Blob([ics], {type:'text/calendar'});
      const url = URL.createObjectURL(blob);
      a.href = url;
      a.download = 'festa-gabi.ics';
    })();

    // Keep glow-on-scroll behavior for #rsvp
    document.querySelectorAll('a[href^="#rsvp"]').forEach(a=>{
      a.addEventListener('click', ()=>{
        setTimeout(()=>{
          const el = document.getElementById('rsvp');
          if (!el) return;
          el.classList.add('glow');
          setTimeout(()=>el.classList.remove('glow'),1600);
        },600);
      });
    });
  </script>

</body>
</html>
